import React, { useState } from 'react';
import axios from 'axios';
import { Modal, Button, Form } from 'react-bootstrap';
import { PropertyDetailsType } from '../../types/types';
import { linkAddProperty } from '../api_links';

interface PropertyFormModalProps {
  show: boolean;
  handleClose: () => void;
  userId: number;
  property?: PropertyDetailsType; // Make property optional
}

const EditPropertyFormModal: React.FC<PropertyFormModalProps> = ({ show, handleClose, userId, property }) => {
  const [alertMessage, setAlertMessage] = useState<string | null>(null);
  const [alertVariant, setAlertVariant] = useState<string | undefined>(undefined);
  const [propertyDetails, setPropertyDetails] = useState<PropertyDetailsType>({
    title: property?.title || '',
    description: property?.description || '',
    location: property?.location || '',
    area: property?.area || '',
    bedrooms: property?.bedrooms || '',
    bathrooms: property?.bathrooms || '',
    price: property?.price || 0,
    near_by: property?.near_by || '',
    seller_id: userId,
  });

  const handleChange: React.ChangeEventHandler<HTMLInputElement | HTMLSelectElement> = (e) => {
    const { name, value } = e.target;
    setPropertyDetails((prevDetails) => ({
      ...prevDetails,
      [name]: value,
    }));
  };

  const handleAddDetails = async (e: React.FormEvent) => {
    e.preventDefault();
    try {
      const response = await axios.put(linkAddProperty.replace(':id', `${id}`), propertyDetails);
      console.log('Status:', response.data);
      if (response.status === 201) {
        setAlertMessage('Property added successfully');
        setAlertVariant('success');
      }
    } catch (error) {
      console.log('there was an error:', error);
      if (axios.isAxiosError(error) && error.response) {
        setAlertMessage('An error occurred while creating the property.');
        setAlertVariant('danger');
      } else {
        setAlertMessage('An error occurred while creating the property.');
        setAlertVariant('danger');
      }
    }
  };

  return (
    <Modal show={show} onHide={handleClose}>
      <Modal.Header closeButton>
        <Modal.Title>{property ? 'Edit Property' : 'Add New Property'}</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <form onSubmit={handleAddDetails} className="container mt-5">
          <div className="mb-3">
            <label htmlFor="title" className="form-label">Title</label>
            <input
              type="text"
              className="form-control"
              id="title"
              name="title"
              value={propertyDetails.title}
              onChange={handleChange}
              required
            />
          </div>
          <div className="mb-3">
            <label htmlFor="description" className="form-label">Description</label>
            <input
              type="text"
              className="form-control"
              id="description"
              name="description"
              value={propertyDetails.description}
              onChange={handleChange}
              required
            />
          </div>
          <div className="mb-3">
            <label htmlFor="location" className="form-label">Location</label>
            <input
              type="text"
              className="form-control"
              id="location"
              name="location"
              value={propertyDetails.location}
              onChange={handleChange}
              required
            />
          </div>
          <div className="mb-3">
            <label htmlFor="area" className="form-label">Area</label>
            <input
              type="text"
              className="form-control"
              id="area"
              name="area"
              value={propertyDetails.area}
              onChange={handleChange}
              required
            />
          </div>
          <div className="mb-3">
            <label htmlFor="bedrooms" className="form-label">Bedrooms</label>
            <select
              className="form-select"
              id="bedrooms"
              name="bedrooms"
              value={propertyDetails.bedrooms}
              onChange={handleChange}
              required
            >
              <option value="1BHK">1BHK</option>
              <option value="2BHK">2BHK</option>
              <option value="3BHK">3BHK</option>
              <option value="4BHK">4BHK</option>
              <option value="5BHK">5BHK</option>
              <option value="6BHK">6BHK</option>
            </select>
          </div>
          <div className="mb-3">
            <label htmlFor="bathrooms" className="form-label">Bathrooms</label>
            <input
              type="text"
              className="form-control"
              id="bathrooms"
              name="bathrooms"
              value={propertyDetails.bathrooms}
              onChange={handleChange}
              required
            />
          </div>
          <div className="mb-3">
            <label htmlFor="price" className="form-label">Price</label>
            <input
              type="number"
              className="form-control"
              id="price"
              name="price"
              value={propertyDetails.price}
              onChange={handleChange}
              required
            />
          </div>
          <div className="mb-3">
            <label htmlFor="near_by" className="form-label">Nearby</label>
            <input
              type="text"
              className="form-control"
              id="near_by"
              name="near_by"
              value={propertyDetails.near_by}
              onChange={handleChange}
              required
            />
          </div>
        </form>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={handleClose}>
          Close
        </Button>
        <Button variant="primary" onClick={handleAddDetails}>
          {property ? 'Save Changes' : 'Post'}
        </Button>
      </Modal.Footer>
    </Modal>
  );
};

export default EditPropertyFormModal;
